import React from "react";
import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import Offcanvas from "react-bootstrap/Offcanvas";
import { NavLink } from "react-router-dom";
import Button from "react-bootstrap/Button";
import Card from "react-bootstrap/Card";
import { useContext } from "react";
import { Appcontext } from "../App";
import { useNavigate } from "react-router-dom";

function Home() {
  const { patientId, userType, doctorId } = useContext(Appcontext);
  let navigate = useNavigate();
  const handleClick1 = async (event) => {
    event.preventDefault();
    try {
      navigate("/stackExchange");
    } catch (error) {
      console.error(error);
    }
  };
  const handleClick2 = async (event) => {
    event.preventDefault();
    try {
      navigate("/stackExchange");
    } catch (error) {
      console.error(error);
    }
  };

  return (
    <>
      {[false].map((expand) => (
        <Navbar key={expand} expand={expand} className="bg-body-tertiary mb-3">
          <Container fluid>
            <NavLink to="">
              <Button
                variant="dark"
                size="lg"
                style={{ fontFamily: "sans-serif" }}
                onClick={handleClick1}
              >
                My Health StackExchange QnA
              </Button>
            </NavLink>

            {userType === "patient" ? (
              <NavLink to="/patientProfile">
                <Button
                  variant="secondary"
                  size="lg"
                  style={{ fontFamily: "sans-serif" }}
                >
                  {patientId}
                </Button>
              </NavLink>
            ) : userType === "doctor" ? (
              <NavLink to="/doctorProfile">
                <Button
                  variant="secondary"
                  size="lg"
                  style={{ fontFamily: "sans-serif" }}
                >
                  {doctorId}
                </Button>
              </NavLink>
            ) : (
              <NavLink to="/patientProfile">
                <Button
                  variant="secondary"
                  size="lg"
                  style={{ fontFamily: "sans-serif" }}
                >
                  myProfile
                </Button>
              </NavLink>
            )}

            <Navbar.Brand
              href="#"
              style={{
                fontSize: "27px",
                fontWeight: "bold",
                textDecoration: "underline",
                fontFamily: "sans-serif",
              }}
            >
              HealthConnect: Streamlined Doctors Appointment And Health Record
              Management-
            </Navbar.Brand>

            <Navbar.Toggle aria-controls={`offcanvasNavbar-expand-${expand}`} />
            <Navbar.Offcanvas
              id={`offcanvasNavbar-expand-${expand}`}
              aria-labelledby={`offcanvasNavbarLabel-expand-${expand}`}
              placement="end"
            >
              <Offcanvas.Body>
                <Nav className="justify-content-end flex-grow-1 pe-3">
                  <div className="d-grid gap-2">
                    <h1
                      style={{
                        fontFamily: "sans-serif",
                        border: "1px solid black",
                        padding: "10px 10px 10px 90px",
                      }}
                    >
                      Login
                    </h1>

                    <NavLink to="/login-admin">
                      <Button
                        variant="dark"
                        size="lg"
                        style={{ fontFamily: "sans-serif" }}
                      >
                        admin
                      </Button>
                    </NavLink>
                    <NavLink to="/login-doctor">
                      <Button
                        variant="dark"
                        size="lg"
                        style={{ fontFamily: "sans-serif" }}
                      >
                        doctor
                      </Button>
                    </NavLink>
                    <NavLink to="/login-patient">
                      <Button
                        variant="dark"
                        size="lg"
                        style={{ fontFamily: "sans-serif" }}
                      >
                        patient
                      </Button>
                    </NavLink>

                    <h1
                      style={{
                        fontFamily: "sans-serif",
                        border: "1px solid black",
                        padding: "10px 10px 10px 90px",
                      }}
                    >
                      SignUp
                    </h1>

                    <NavLink to="/signup-doctor">
                      <Button
                        variant="dark"
                        size="lg"
                        style={{ fontFamily: "sans-serif" }}
                      >
                        doctor
                      </Button>
                    </NavLink>
                    <NavLink to="/signup-patient">
                      <Button
                        variant="dark"
                        size="lg"
                        style={{ fontFamily: "sans-serif" }}
                      >
                        patient
                      </Button>
                    </NavLink>
                  </div>
                </Nav>
              </Offcanvas.Body>
            </Navbar.Offcanvas>
          </Container>
        </Navbar>
      ))}

      <Card style={{ width: "34rem", margin: "20px" }}>
        <Card.Header as="h5" style={{ fontFamily: "sans-serif" }}>
          StackExchange Page
        </Card.Header>
        <Card.Body>
         
          <Button
            variant="dark"
            size="lg"
            style={{ fontFamily: "sans-serif" }}
            onClick={handleClick2}
          >
            Query Health StackExchange QnA
          </Button>
        </Card.Body>
      </Card>
    </>
  );
}

export default Home;
